import "./style.css";

import { Link } from 'react-router-dom';

import DefaulterIcon from "../../../assets/defaulter.svg";
import ExpandedIcon from "../../../assets/expanded.svg";

function CardListClients({ status, list, clients }) {
  return (
    <div className="Clients CardContainer">
      <div className="CardTitle">
        <div className="CardIcon">
            <img
              src={status === "defaulter" ? DefaulterIcon : ExpandedIcon}
              alt="Icon"
              className="Icon"
            />
            <h1>
              {status === "defaulter" ? "Clientes Inadimplentes" : "Clientes em dia"}
            </h1>
        </div>
        <p className={status === "defaulter" ? "ClientCount Red" : "ClientCount Green"}>
          {data.length}
        </p>
      </div>
      <div className="TableContainer">
        <div className="TableHead">
          <strong className="TableColumn FirstColumn">
            Clientes
          </strong>
          <strong className="TableColumn MidColumn">
            ID do clie.
          </strong>
          <strong className="TableColumn LastColumns">
            Valor
          </strong>
        </div>
        <div className="TableBody">
          {list.map((item) => {
            return (
              <div className="TableRow" key={item.id}>
                <span className="TableColumn FirstColumn">{item.name}</span>
                <span className="TableColumn MidColumns">
                  item.clientID
                </span>
                <span className="TableColumn LastColumns">
                  R$ {item.value}
                </span>
              </div>
            );
          })}
        </div>
        <div className="CardBottom">
          <Link to='/debt-collection'>Ver todos</Link>
        </div>
      </div>
    </div>
  );
}

export default CardListClients;
